          "patch": "@@ -0,0 +1,21 @@\n+const initData = {\n+  events: [],\n+}\n+const fetchGitHub = (user) => {\n+  axios.get(`https://api.github.com/users/${user}/events`)\n+    .then(res => (\n+        {\n+          ...initData,\n+          events:\n+            [\n+              ...res.data\n+                .filter(event => event.payload.commits)\n+                .map(event => event),\n+            ]\n+        }\n+      )\n+    )\n+  .catch(err => console.error(err))\n+}\n+\n+module.exports = fetchGitHub;"
