          "contents_url": "https://api.github.com/repos/zacacollier/pug-postcss-boilerplate/contents/src/js/site-v1.js?ref=8d12c678d2760199c004942ef03b88ed9da22a24",
          "patch": "@@ -0,0 +1,153 @@\n+var container;\n+var camera, scene, raycaster, renderer, parentTransform, sphereInter;\n+var mouse = new THREE.Vector2();\n+var el = document.getElementById('screen');\n+var commitDesc = document.getElementById('commit-desc');\n+var commitDate = document.getElementById('commit-date');\n+var radius = 100,\n+  theta = 0;\n+var currentIntersected;\n+init();\n+animate();\n+\n+function updateInfo(i) {\n+  //console.log(o);\n+  commitDesc.innerHTML = \"test\";\n+  commitDate.innerHTML = \"test2\";\n+}\n+\n+function fakeData() {\n+  var data = new Array(50);\n+  var len = data.length;\n+  while (len--) {\n+    data[len] = ({\n+      created_at: new Date(),\n+      commit: \"test \" + Math.random(),\n+      lines_added: Math.round(Math.random() * 100),\n+      lines_removed: Math.round(Math.random() * 100)\n+    })\n+  }\n+  return data;\n+}\n+\n+function init() {\n+  // temporary until github\n+  var data = fakeData();\n+\n+  container = document.createElement('div');\n+  el.appendChild(container);\n+  camera = new THREE.PerspectiveCamera(70, window.innerWidth / window.innerHeight, 1, 10000);\n+  scene = new THREE.Scene();\n+  var geometry = new THREE.SphereGeometry(5);\n+  var material = new THREE.MeshBasicMaterial({\n+    color: 0x999999\n+  });\n+  sphereInter = new THREE.Mesh(geometry, material);\n+  sphereInter.visible = false;\n+  scene.add(sphereInter);\n+  var geometry = new THREE.Geometry();\n+  var point = new THREE.Vector3();\n+  var direction = new THREE.Vector3();\n+  // 50 would be lines length\n+  for (var i = 0; i < 50; i++) {\n+    var materialx = new THREE.LineBasicMaterial({\n+            color: \"0xFF00FF\",\n+            lineWidth: 1\n+    });\n+    direction.x += Math.random() - 0.5;\n+    direction.y += Math.random() - 0.5;\n+    direction.z += Math.random() - 0.5;\n+    direction.normalize().multiplyScalar(10);\n+    point.add(direction);\n+    geometry.vertices.push(point.clone());\n+  }\n+  parentTransform = new THREE.Object3D();\n+  parentTransform.position.x = Math.random() * 40 - 20;\n+  parentTransform.position.y = Math.random() * 40 - 20;\n+  parentTransform.position.z = Math.random() * 40 - 20;\n+  parentTransform.rotation.x = Math.random() * 2 * Math.PI;\n+  parentTransform.rotation.y = Math.random() * 2 * Math.PI;\n+  parentTransform.rotation.z = Math.random() * 2 * Math.PI;\n+  parentTransform.scale.x = Math.random() + 0.5;\n+  parentTransform.scale.y = Math.random() + 0.5;\n+  parentTransform.scale.z = Math.random() + 0.5;\n+  for (var i = 0; i < data.length /*50*/ ; i++) {\n+    var object;\n+    if (Math.random() > 0.5) {\n+      object = new THREE.Line(geometry);\n+    } else {\n+      object = new THREE.LineSegments(geometry);\n+    }\n+    object.position.x = Math.random() * 400 - 200;\n+    object.position.y = Math.random() * 400 - 200;\n+    object.position.z = Math.random() * 400 - 200;\n+    object.rotation.x = Math.random() * 2 * Math.PI;\n+    object.rotation.y = Math.random() * 2 * Math.PI;\n+    object.rotation.z = Math.random() * 2 * Math.PI;\n+    object.scale.x = Math.random() + 0.5;\n+    object.scale.y = Math.random() + 0.5;\n+    object.scale.z = Math.random() + 0.5;\n+    parentTransform.add(object);\n+  }\n+  scene.add(parentTransform);\n+  raycaster = new THREE.Raycaster();\n+  raycaster.linePrecision = 3;\n+  renderer = new THREE.WebGLRenderer({\n+    antialias: true,\n+    alpha: true\n+  });\n+  renderer.setClearColor(0x999999, 0);\n+  renderer.setPixelRatio(window.devicePixelRatio);\n+  renderer.setSize(window.innerWidth, window.innerHeight);\n+  container.appendChild(renderer.domElement);\n+  document.addEventListener('mousemove', onDocumentMouseMove, false);\n+  //\n+  window.addEventListener('resize', onWindowResize, false);\n+}\n+\n+function onWindowResize() {\n+  camera.aspect = window.innerWidth / window.innerHeight;\n+  camera.updateProjectionMatrix();\n+  renderer.setSize(window.innerWidth, window.innerHeight);\n+}\n+\n+function onDocumentMouseMove(event) {\n+  event.preventDefault();\n+  mouse.x = (event.clientX / window.innerWidth) * 2 - 1;\n+  mouse.y = -(event.clientY / window.innerHeight) * 2 + 1;\n+}\n+//\n+function animate() {\n+  requestAnimationFrame(animate);\n+  render();\n+}\n+\n+function render() {\n+  theta += 0.1;\n+  camera.position.x = radius * Math.sin(THREE.Math.degToRad(theta));\n+  camera.position.y = radius * Math.sin(THREE.Math.degToRad(theta));\n+  camera.position.z = radius * Math.cos(THREE.Math.degToRad(theta));\n+  camera.lookAt(scene.position);\n+  camera.updateMatrixWorld();\n+  // find intersections\n+  raycaster.setFromCamera(mouse, camera);\n+  var intersects = raycaster.intersectObjects(parentTransform.children, true);\n+  if (intersects.length > 0) {\n+    if (currentIntersected !== undefined) {\n+      currentIntersected.material.linewidth = 1;\n+    }\n+    currentIntersected = intersects[0].object;\n+    updateInfo(currentIntersected);\n+    currentIntersected.material.linewidth = 5;\n+    sphereInter.visible = true;\n+    sphereInter.position.copy(intersects[0].point);\n+  } else {\n+    if (currentIntersected !== undefined) {\n+      currentIntersected.material.linewidth = 1;\n+    }\n+    currentIntersected = undefined;\n+    sphereInter.visible = false;\n+  }\n+  renderer.render(scene, camera);\n+}\n+"
