          "blob_url": "https://github.com/zacacollier/HowToComputer/blob/a0985541854869daadfa68f04db8409f75ab3f42/hotkeys.md",
          "raw_url": "https://github.com/zacacollier/HowToComputer/raw/a0985541854869daadfa68f04db8409f75ab3f42/hotkeys.md",
