          "patch": "@@ -0,0 +1,53 @@\n+/* Generated by Fontie <http://fontie.pixelsvsbytes.com> */\n+\n+@font-face {\n+    font-family:'Simplon';\n+    src: url('../fonts/P Bold.eot');\n+\tsrc: url('../fonts/P Bold.eot?#iefix') format('embedded-opentype'),\n+\t\turl('../fonts/P Bold.woff2') format('woff2'),\n+\t\turl('../fonts/P Bold.woff') format('woff'),\n+\t\turl('../fonts/P Bold.svg#P Bold') format('svg');\n+    font-weight: 700;\n+    font-style: normal;\n+    font-stretch: normal;\n+    unicode-range: U+0020-00FE;\n+}\n+\n+@font-face {\n+    font-family:'Simplon';\n+    src: url('../fonts/P Light.eot');\n+\tsrc: url('../fonts/P Light.eot?#iefix') format('embedded-opentype'),\n+\t\turl('../fonts/P Light.woff2') format('woff2'),\n+\t\turl('../fonts/P Light.woff') format('woff'),\n+\t\turl('../fonts/P Light.svg#P Light') format('svg');\n+    font-weight: 300;\n+    font-style: normal;\n+    font-stretch: normal;\n+    unicode-range: U+0020-00FE;\n+}\n+\n+@font-face {\n+    font-family:'Simplon';\n+    src: url('../fonts/P Medium.eot');\n+\tsrc: url('../fonts/P Medium.eot?#iefix') format('embedded-opentype'),\n+\t\turl('../fonts/P Medium.woff2') format('woff2'),\n+\t\turl('../fonts/P Medium.woff') format('woff'),\n+\t\turl('../fonts/P Medium.svg#P Medium') format('svg');\n+    font-weight: 500;\n+    font-style: normal;\n+    font-stretch: normal;\n+    unicode-range: U+0020-00FE;\n+}\n+\n+@font-face {\n+    font-family:'Simplon';\n+    src: url('../fonts/P Regular.eot');\n+\tsrc: url('../fonts/P Regular.eot?#iefix') format('embedded-opentype'),\n+\t\turl('../fonts/P Regular.woff2') format('woff2'),\n+\t\turl('../fonts/P Regular.woff') format('woff'),\n+\t\turl('../fonts/P Regular.svg#P Regular') format('svg');\n+    font-weight: 400;\n+    font-style: normal;\n+    font-stretch: normal;\n+    unicode-range: U+0020-00FE;\n+}"
