          "patch": "@@ -8,57 +8,54 @@\n </head>\n <header></header>\n <div class=\"article-wrapper\">\n+  <figure class=\"my-face\"><img src=\"../src/img/my-face-what-it-looks-like.jpg\"></figure>\n   <div class=\"image\" id=\"screen\">\n     <h2 class=\"caption\">First, solve the problem. Then, write the code.\n       <cite>&mdash; John Johnson</cite>\n     </h2>\n   </div>\n   <div class=\"text\">\n-    <div class=\"intro row\"><img src=\"../src/img/signature_ivory.png\"/>\n-      <h2 class=\"lead\">A passionate full-stack developer specializing in building robust applications with React + Redux and Node.</h2>\n+    <div class=\"intro row\">\n+      <div class=\"intro__contain\"><img class=\"logo\" src=\"../src/img/signature_ivory.png\">\n+        <h2 class=\"lead\">A passionate full-stack developer specializing in building robust applications with React + Redux and Node.</h2>\n+      </div>\n     </div>\n     <article class=\"mag content credentials row\">\n       <h3>TL;DR</h3>\n       <ul>\n-        <li> JavaScript</li>\n+        <li> JavaScript</li>\n         <li>Knowledgeable in React + Redux</li>\n         <li>Self-starting team player and collaborator</li>\n         <li>Regular Contributor to <a href=\"https://github.com/zacacollier/\"><i class=\"fa fa-github\"></i> Open Source</a></li>\n       </ul>\n       <h3>Skills</h3>\n+      <h4>Languages &amp; Frameworks:</h4>\n       <ul>\n-        <ul>\n-          <h4>Languages & Frameworks:\n-            <li>JavaScript ES6 / ES7</li>\n-            <li>React + Redux</li>\n-            <li>Node.js</li>\n-            <li>Express</li>\n-            <li>MongoDB / Mongoose</li>\n-            <li>jQuery</li>\n-            <li>W3C-Spec HTML & CSSBootstrap 3 / 4</li>\n-          </h4>\n-        </ul>\n-        <ul>\n-          <h4>Architectures &amp; Strategies:\n-            <li>Experience building and optimizing REST APIs</li>\n-            <li>Firm grasp of developing relational schemae with Mongoose</li>\n-            <li>Knowledgable with implementing authentication via basic JWT strategies or OAuth social integrations</li>\n-          </h4>\n-        </ul>\n-        <ul>\n-          <h4>Development Best Practices:\n-            <li>Disciplined usage of Git to properly organize project workflow</li>\n-            <li>Knowledge of test-driven development protocols such as Mocha, TAP / tape, Travis and Circle CI</li>\n-            <li>Some experience with Type systems such as Immutable JS, TypeScript, and React PropTypes</li>\n-          </h4>\n-        </ul><br>\n-        <ul>\n-          <h4>Linux / BSD:\n-            <li>Firm grasp of Linux / BSD filesystem & common commands</li>\n-            <li>Avid Vim user and contributor to a well-regarded dotfiles repository maintained by Greg Hurrell at Facebook's Relay team</li>\n-            <li>Experience working with several package managers including brew, apt, yum, portage and pacman.</li>\n-          </h4>\n-        </ul>\n+        <li>JavaScript ES6 / ES7</li>\n+        <li>React + Redux</li>\n+        <li>Node.js</li>\n+        <li>Express</li>\n+        <li>MongoDB / Mongoose</li>\n+        <li>jQuery</li>\n+        <li>W3C-Spec HTML &amp; CSSBootstrap 3 / 4</li>\n+      </ul>\n+      <h4>Architectures &amp; Strategies:</h4>\n+      <ul>\n+        <li>Experience building and optimizing REST APIs</li>\n+        <li>Firm grasp of developing relational schemae with Mongoose</li>\n+        <li>Knowledgable with implementing authentication via basic JWT strategies or OAuth social integrations</li>\n+      </ul>\n+      <h4>Development Best Practices:</h4>\n+      <ul>\n+        <li>Disciplined usage of Git to properly organize project workflow</li>\n+        <li>Knowledge of test-driven development protocols such as Mocha, TAP / tape, Travis and Circle CI</li>\n+        <li>Some experience with Type systems such as Immutable JS, TypeScript, and React PropTypes</li>\n+      </ul>\n+      <h4>Linux / BSD:</h4>\n+      <ul>\n+        <li>Firm grasp of Linux / BSD filesystem &amp; common commands</li>\n+        <li>Avid Vim user and contributor to a well-regarded dotfiles repository maintained by Greg Hurrell at Facebook's Relay team</li>\n+        <li>Experience working with several package managers including brew, apt, yum, portage and pacman.</li>\n       </ul>\n       <p>I am a disciplined, task-driven developer with a passion for excellent code quality and an unwavering dedication to my team. I thrive on seeing my peers succeed. My love for software development is energized by an inherent spirit of collaboration.</p>\n       <p>I work diligently to make myself a dependable resource for those around me by efficiently responding to their needs and contributing thoughtful insight to optimizing long-term implementation strategies.</p>\n@@ -73,5 +70,6 @@ <h2 class=\"lead\">A passionate full-stack developer specializing in building robu\n         <li><a href=\"https://medium.com/@zacharycollier/\"><i class=\"fa fa-medium\"></i></a></li>\n       </ul>\n     </footer>\n+    <div class=\"tested\"></div>\n   </div>\n </div>\n\\ No newline at end of file"
