          "patch": "@@ -0,0 +1,65 @@\n+{\n+  \"name\": \"follow-redirects\",\n+  \"version\": \"1.2.3\",\n+  \"description\": \"HTTP and HTTPS modules that follow redirects.\",\n+  \"main\": \"index.js\",\n+  \"scripts\": {\n+    \"test\": \"xo && BLUEBIRD_DEBUG=1 nyc mocha\"\n+  },\n+  \"repository\": {\n+    \"type\": \"git\",\n+    \"url\": \"git@github.com:olalonde/follow-redirects.git\"\n+  },\n+  \"homepage\": \"https://github.com/olalonde/follow-redirects\",\n+  \"bugs\": {\n+    \"url\": \"https://github.com/olalonde/follow-redirects/issues\"\n+  },\n+  \"keywords\": [\n+    \"http\",\n+    \"https\",\n+    \"url\",\n+    \"redirect\",\n+    \"client\",\n+    \"location\",\n+    \"utility\"\n+  ],\n+  \"author\": {\n+    \"name\": \"Olivier Lalonde\",\n+    \"email\": \"olalonde@gmail.com\",\n+    \"url\": \"http://www.syskall.com\"\n+  },\n+  \"contributors\": [\n+    \"James Talmage <james@talmage.io>\",\n+    \"Ruben Verborgh <ruben@verborgh.org> (https://ruben.verborgh.org/)\"\n+  ],\n+  \"files\": [\n+    \"index.js\",\n+    \"create.js\",\n+    \"http.js\",\n+    \"https.js\"\n+  ],\n+  \"dependencies\": {\n+    \"debug\": \"^2.4.5\"\n+  },\n+  \"devDependencies\": {\n+    \"bluebird\": \"^3.4.0\",\n+    \"concat-stream\": \"^1.5.2\",\n+    \"coveralls\": \"^2.11.15\",\n+    \"express\": \"^4.13.0\",\n+    \"mocha\": \"^3.2.0\",\n+    \"nyc\": \"^10.0.0\",\n+    \"xo\": \"^0.17.1\"\n+  },\n+  \"license\": \"MIT\",\n+  \"nyc\": {\n+    \"reporter\": [\n+      \"lcov\",\n+      \"text\"\n+    ]\n+  },\n+  \"xo\": {\n+    \"envs\": [\n+      \"mocha\"\n+    ]\n+  }\n+}"
